subSubSection.paragraph:
Male foreleg (
Fig. 36c
): femur with two short, stout spines in basal third near ventral surface. Tibia with one short spine in medio-ventral portion. Pala with 2 setae dorsally; 12 setae in upper palar row and 13–15 setae in lower palar row, lower row setae more pronounced than those of dorsal row. Apex of pala with a shorter thickened seta. Palar claw (
Fig. 36d
) broad, apex broadly rounded. Female foreleg with same general setal arrangement as male. Mesotarsal claws equaling about one-half the length of the mesotarsus.
